export function indexSellRequest() {
  return {
    type: "@sell/INDEX_SELL_REQUEST",
  };
}

export function indexSellSuccess(body) {
  return {
    type: "@sell/INDEX_SELL_SUCCESS",
    payload: { body },
  };
}

export function sellFailure(message, reasons) {
  return {
    type: "@sell/SELL_FAILURE",
    payload: { message, reasons },
  };
}

export function resetPage() {
  return {
    type: "@sell/RESET_PAGE",
  };
}

export function resetSell() {
  return {
    type: "@sell/RESET_SELL",
  };
}
